def getMajority(votes):
    votes = sorted(votes)
    majority = votes[0]
    maxCount = 0
    count = 0
    for vote in votes:
        if vote == majority:
            count += 1
            if count > maxCount:
                maxCount = count
        else:
            majority = vote
            count = 1
    if maxCount > len(votes)/2:
        return majority
    return "Runoff!"

